import React, {Component} from 'react';
import './../CSS/Timeline.css'
import './../../node_modules/bootstrap/dist/css/bootstrap.min.css'
function NewsFeed(props){
    return(
        <div className="post">
            <h2>Title : {props.value.title}</h2>
            <img className="articleImg" src= {props.value.urlToImage}/>

            <div>
                Description : {props.value.description}
                <a href={props.value.url}> Read More </a>
            </div>
            <div className="card">
                <img className="card-img-top" src={props.value.urlToImage} alt="Image not Availabe" />
                <div className="card-body">
                    <h5 className="card-title">{props.value.title}</h5>
                    <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                    <a href="#" className="btn btn-primary">Go somewhere</a>
                </div>
            </div>

        </div>
    );


}

export default NewsFeed;
